import React from 'react';
import MarkDown from 'react-markdown'

const md = '| for-editor | markdown editor |'

interface Interface {

}

const Index: React.FC<Interface> = (props) => {

    return (
        <div>
            <MarkDown source={md}/>
        </div>
    );
}

export default Index
